import './about.css';
import Aboutimg from '../../assets/avatar-2.svg';

const About = () => {
  return (
    <section className='about container section' id='about'>
      <h2 className='section_title'>About Me</h2>
      <div className='about_container grid'>
        <img src={Aboutimg} alt='' className='about_img' />
        <div className='about_data grid'>
          <div className='about_info'>
            <p className='about_description'>I am Marruf Mihal, Web application developer from Tampa, FLorida. I have over 7 years of experince in the field of Web Application Development and 2 years of experince in Mobile App Development. Some of my key coding skills includes, React Js, Next Js, Javascript, HTML, CSS, Tailwind Css, Node Js, Express Js, MongoDB and More.</p>
            <a href='' className='btn'>Download Resume</a>
          </div>
        </div>
      </div>
    </section>
  )
}

export default About
